function rgbToHsv(r, g, b) {
  r /= 255.0;
  g /= 255.0;
  b /= 255.0;
  let mx = Math.max(r, g, b);
  let mn = Math.min(r, g, b);
  let df = mx - mn;
  let h, s, v;

  if (mx === mn) {
      h = 0;
  } else if (mx === r) {
      h = (60 * ((g - b) / df) + 360) % 360;
  } else if (mx === g) {
      h = (60 * ((b - r) / df) + 120) % 360;
  } else if (mx === b) {
      h = (60 * ((r - g) / df) + 240) % 360;
  }

  s = mx === 0 ? 0 : (df / mx) * 100;
  v = mx * 100;

  return [h, s, v];  
}

